import{_ as e,o,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 33.2-609 Conveyance of toll bridge by Commonwealth.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-609.md","filePath":"vacode/33.2-609.md"}'),n={name:"vacode/33.2-609.md"},r=a('<h1 id="§-33-2-609-conveyance-of-toll-bridge-by-commonwealth" tabindex="-1">§ 33.2-609 Conveyance of toll bridge by Commonwealth. <a class="header-anchor" href="#§-33-2-609-conveyance-of-toll-bridge-by-commonwealth" aria-label="Permalink to &quot;§ 33.2-609 Conveyance of toll bridge by Commonwealth.&quot;">​</a></h1><p>In the event a toll bridge, at the time it is purchased by the Commonwealth under the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/33.2-602/" target="_blank" rel="noreferrer">33.2-602</a> through <a href="http://law.lis.virginia.gov/vacode/33.2-610/" target="_blank" rel="noreferrer">33.2-610</a>, is not on the line of a highway then in one of the systems of state highways, the Commissioner of Highways may convey such toll bridge and approaches and other property to such county or counties in which it may be in whole or in part located, upon the payment by such county or counties of the amount paid by the Commonwealth for such toll bridge and approaches and other property, with interest on such amount at six percent per year from the time of such payment by the Commonwealth. The conveyance shall be executed in the name and on behalf of the Commonwealth by the Commissioner of Highways.</p><p>Code 1950, § 33-225; 1970, c. 322, § 33.1-265; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',3),h=[r];function i(c,l,s,m,d,p){return o(),t("div",null,h)}const y=e(n,[["render",i]]);export{_ as __pageData,y as default};
